// src/App.js
import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link, useNavigate, useParams } from "react-router-dom";

import Home from "./components/Home";
import Login from "./components/Login";
import AddEvent from "./components/AddEvent";
import UpdateEvent from "./component/UpdateEvent";
import EventDetails from "./component/EventDetails";
import "./styles.css";

function App(){
  const [user, setUser] = useState(null);

  const handleLogout = () => setUser(null);

  // wrappers to provide hooks + pass props down
  function HomeWrapper(){
    const navigate = useNavigate();
    const handleOpen = (id) => navigate(`/event/${id}`);
    const handleEdit = (id) => navigate(`/update/${id}`);
    const handleAdd = () => navigate('/add');
    const handleReport = (id) => {
      // placeholder: you can fetch & show report modal
      alert('Request report for: ' + id);
    };

    return (
      <Home
        user={user}
        onOpen={handleOpen}
        onEdit={handleEdit}
        onAdd={handleAdd}
        onReport={handleReport}
        onLogout={handleLogout}
      />
    );
  }

  function LoginWrapper(){
    const navigate = useNavigate();
    const onLogin = (logged) => { setUser(logged); navigate('/'); };
    return <Login onLogin={onLogin} />;
  }

  function AddWrapper(){
    const navigate = useNavigate();
    const onBack = () => navigate(-1);
    return <AddEvent user={user} onBack={onBack} />;
  }

  function UpdateWrapper(){
    const { id } = useParams();
    const navigate = useNavigate();
    const onBack = () => navigate(-1);
    return <UpdateEvent id={id} user={user} onBack={onBack} />;
  }

  function EventWrapper(){
    const { id } = useParams();
    const navigate = useNavigate();
    const onBack = () => navigate(-1);
    const onEdit = (editId) => navigate(`/update/${editId}`);
    return <EventDetails id={id} user={user} onBack={onBack} onEdit={onEdit} />;
  }

  return (
    <Router>
      <div className="app">
        <header className="header">
          <h1>INC Event Management</h1>
          <nav style={{ marginLeft: "auto" }}>
            <Link className="button" to="/">Home</Link>
            <Link className="button" to="/add">Add Event</Link>
            {!user ? <Link className="button" to="/login">Login</Link> : <button className="button secondary" onClick={handleLogout}>Logout</button>}
          </nav>
        </header>

        <main>
          <Routes>
            <Route path="/" element={<HomeWrapper />} />
            <Route path="/login" element={<LoginWrapper />} />
            <Route path="/add" element={<AddWrapper />} />
            <Route path="/update/:id" element={<UpdateWrapper />} />
            <Route path="/event/:id" element={<EventWrapper />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
